declare module 'path' {
  export const basename: (path: string) => string;
  export const dirname: (path: string) => string;
  export const endsWith: (path: string, suffix: string) => boolean;
  export const extname: (path: string) => string;
  export const get: (path: string) => any;
  export const isAbsolute: (path: string) => boolean;
  export const join: (...paths: string[]) => string;
  export const length: number;
  export const node: any;
  export const normalize: (path: string) => string;
  export const parse: (path: string) => any;
  export const posix: any;
  export const relative: (from: string, to: string) => string;
  export const remove: (path: string) => string;
  export const replace: (path: string, searchValue: string | RegExp, replaceValue: string) => string;
  export const replaceWith: (path: string, searchValue: string | RegExp, replaceValue: string) => string;
  export const resolve: (...paths: string[]) => string;
  export const sep: string;
  export const slice: (start?: number, end?: number) => string;
  export const win32: any;
}

declare module 'playwright/lib/transform/babelBundle' {
  export function setTransformData(data: any): void;
}

declare module 'playwright/lib/transform/transform' {
  export function setTransformData(data: any): void;
}
